import '../App.css'
import '../bootstrap.min.css'
import Planet from "../Components/Planet";

function Home() {


    return (

        <div className={"bgblack container-fluid"}>
            <div className={"bggrain container-fluid w-100"}>
                <div className={"pt-5 text-center"}>
                    <div className={"w-50"}>
                        <Planet className={""} image={"./Earthi.glb"}></Planet>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
